      if ($trayek != $oldtrayek) {
        $id = $dt->save($dtu);
        $oldtrayek = $trayek;
      }

      if ($id) {
        foreach ($arah as $v) {
          list($lat, $long) = explode(',', $v);
          $dtur = array('trayek_umum_id' => $id, 'type' => $type, 'lat' => $lat, 'long' => $long);
          $st->save($dtur);
        }
      }
      $n++;
    }
    return new \PetakUmpet\Response('Finished processing ' . $n .' trayek inserted at ' . date('Y-m-d H:i:s'));
  } 

}